import { Routes, Route } from 'react-router-dom';
const Home = lazy(() => import("./Users/Home"));
const BookHome = lazy(() => import("./Books/BookHome"));
const UsersHome = lazy(() => import("./Users/UsersHome"));
const Users = lazy(() => import("./Users/Users"));
const UserDetails = lazy(() => import("./Users/UserDetails"));


function App() {
  return (
    <div className="app">
    <header />
    <ErrorBoundary FallComponent>
    <Suspense fallback={<div>Loading</div>}>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/books/*" element={<BookHome />} />

        <Route path="/users" element={<UsersHome />}>
        <Route path="" element={<Users />}/>
        <Route path=":id" element={<UserDetails />} />{" "}
        </Route>

        <Route path="*" element={<div>404 Page</div>} /> {""}
      </Routes>
      </Suspense>
      </ErrorBoundary>
    </div>
  );
}

export default App;
